#include <windows.h>
#include <time.h>

int comps, trocas;
LARGE_INTEGER frequency;
LARGE_INTEGER start;
LARGE_INTEGER end;
double elapsed_time;

FILE *criarArquivo(const char *nomeArquivo, const char *modo) {
  FILE *arquivo = fopen(nomeArquivo, modo);
  if (arquivo == NULL) {
    printf("Erro ao abrir o arquivo %s.\n", nomeArquivo);
    exit(EXIT_FAILURE);
  }
  return arquivo;
}

//Funcao para embaralhar o vetor (adaptação do Fisher–Yates shuffle)
int shuffleArray(int vet[], int n) {
    int i, j, temp, count = 0;
    int size = sizeof(*vet) / sizeof(vet[0]);
    double randomizationFactor; //Grau de ordenacao
    double nextDouble;

    srand(time(NULL));

    for (i = 0; i < n; i++) {
        if(vet[i] <= vet[i+1]) {
            count++;
        } 
    }

    count = 0;

    for (i = n - 1; i > 0; i--) {
        randomizationFactor = (double)rand() / (double)RAND_MAX;
        nextDouble = (double)rand() / (double)RAND_MAX;
        if (nextDouble < randomizationFactor) {
            j = rand() % n;
            temp = vet[i];
            vet[i] = vet[j];
            vet[j] = temp;
            count++;
        }
    }

    return *vet;
}

//Função auxiliar para trocar o conteúdo de duas posições do vetor
void troca(int *x, int *y)
{
    int temp = *x;
    *x = *y;
    *y = temp;
}

int bubble_sort(int vet[], int n){
    QueryPerformanceFrequency(&frequency);
    QueryPerformanceCounter(&start);

    shuffleArray(vet, n);

    int i, j, houve_troca = 1;
    comps = trocas = 0;

    for(i = 0; i < n-1 && houve_troca; i++){
        houve_troca = 0;
        for(j = 0; j < n-i-1; j++){
          comps++;
          if (vet[j] > vet[j+1]){
              troca(&vet[j], &vet[j+1]);
              houve_troca = 1;
              trocas++;
          }
        }
    }

    QueryPerformanceCounter(&end);
    elapsed_time = (double)(end.QuadPart - start.QuadPart) / frequency.QuadPart;
}

